import React from 'react';
import './Logo.css';

const Logo = () => {
  return (
    <div className="logo-container">
      <svg className="star" viewBox="0 0 51 60" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M25.5 0L31.4617 18.3647H50.7553L35.1468 29.7205L41.1085 48.0853L25.5 36.7295L9.89154 48.0853L15.8532 29.7205L0.244658 18.3647H19.5383L25.5 0Z" stroke="currentColor" strokeWidth="1"/>
        <line x1="25.5" y1="48" x2="25.5" y2="60" stroke="currentColor" strokeWidth="1"/>
      </svg>
      <div className="logo-text">Repute</div>
    </div>
  );
};

export default Logo;
